import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'
import store from './redux/store';
import { Provider } from 'react-redux';

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}>
        <App state={store.getState()}/> 
      </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);
